- input: TEXT,F3A,,"Memo entries have been recorded for travel reimbursements to campaign
    employees where a vendor has been paid $200 or more in the aggregate.  The remainder
    of such reimbursements were primarily for mileage.                                                                      This
    amendment corrects the aggregate amount for Mr. Hirsch.  We believe the cycle-to-date
    totals for expenditures are correct, and have amended the post-election 2004 report
    in order to resolve the discrepancy in those aggregates."
